import React, {useState} from 'react';
import '../css/CadetsPage.css'

const GroupPage = () => {
    const [cadets, setCadets] = useState([])
    return (
        <div>
            <div className={"cadet-page-container"}>
                <div className={"cadet-page-title"}>Списки нарядів</div>
                <div className={"cadet-page-table"}>
                    <div className={"cadet-page-table-l1"}>
                        <div>№</div>
                        <div>Група що заступає</div>
                        <div>Дата заступання</div>
                    </div>
                    {cadets.map((d, index) => (
                        <div className={"cadet-page-table-l2"} key={d.id}>
                            <div>{index}</div>
                            <div>{d.groupId}</div>
                            <div>{d.date_of_substitution.split('T')[0]}</div>
                        </div>
                    ))}
                </div>
                <div>

                </div>
            </div>
        </div>
    );
};

export default GroupPage;
